import maison1 from '../public/assets/images/maison1.jpg';


function Pictures() {
    return(
        <div>

            <div className="images" id="maison1">

               <img src={"./assets/images/maison1.jpg"} alt="Maison 1" />
                
            </div>

            <div className="images" id="maison2">

               <img src={"../assets/images/maison2.jpeg"} alt="Maison 2" />

            </div>

            <div className="images" id="maison3">

               <img src={"../assets/images/maison3.jpeg"} alt="Maison 3" />

            </div>

        </div>
    )
}

export default Pictures;
